pD("common/io/filesystem.effekt",'module io/filesystem\n\nimport bytearray\n\nimport io\nimport io/error\n\n\n/// A file descriptor. Should not be inspected.\ntype File \x3d Int\n\n\n/// Reads a file at given path as utf8 encoded string.\ndef readFile(path: String): String / Exception[IOError] \x3d {\n  val file \x3d openForReading(path);\n  with on[IOError].finalize { close(file) }\n\n  val chunkSize \x3d 1048576 // 1MB\n  var buffer \x3d bytearray::allocate(chunkSize)\n  var offset \x3d 0\n\n  def go(): String \x3d {\n    read(file, buffer, offset, chunkSize, -1) match {\n      case 0 \x3d\x3e\n        buffer.resize(offset).toString\n      case n \x3d\x3e\n        offset \x3d offset + n\n        if (offset + chunkSize \x3e buffer.size) {\n          buffer \x3d buffer.resize(2 * buffer.size)\n        }\n        go()\n    }\n  }\n\n  go()\n}\n\n/// Writes the (utf8 encoded) string `contents` into the specified file.\ndef writeFile(path: String, contents: String): Unit / Exception[IOError] \x3d {\n  val file \x3d openForWriting(path);\n  with on[IOError].finalize { close(file) }\n\n  val chunkSize \x3d 1048576 // 1MB\n  val buffer \x3d contents.fromString\n  var offset \x3d 0;\n\n  def go(): Unit \x3d {\n    val n \x3d write(file, buffer, offset, min(buffer.size - offset, chunkSize), -1)\n    offset \x3d offset + n\n    if (offset \x3c buffer.size) { go() }\n  }\n\n  go()\n}\n\n/// Appends the (utf8 encoded) string `contents` to the specified file.\ndef appendFile(path: String, contents: String): Unit / Exception[IOError] \x3d {\n  val file \x3d openForAppending(path);\n  with on[IOError].finalize { close(file) }\n\n  val chunkSize \x3d 1048576 // 1MB\n  val buffer \x3d contents.fromString\n  var offset \x3d 0;\n\n  def go(): Unit \x3d {\n    val n \x3d write(file, buffer, offset, min(buffer.size - offset, chunkSize), -1)\n    offset \x3d offset + n\n    if (offset \x3c buffer.size) { go() }\n  }\n\n  go()\n}\n\n/// An abstract interface applications can program against.\n///\n/// Can be interpreted with the `filesystem` handler, or virtualized etc.\n///\n/// See example below.\ninterface Files {\n  def readFile(path: String): String\n  def writeFile(path: String, contents: String): Unit\n}\n\n/// Using the file system via node.js\ndef filesystem[R] { program: \x3d\x3e R / Files }: R / Exception[IOError] \x3d // TODO move Exception to be bidirectional\n  try { program() }\n  with Files {\n    def readFile(path) \x3d resume(readFile(path))\n    def writeFile(path, contents) \x3d resume(writeFile(path, contents))\n  }\n\n\ndef openForReading(path: String): File / Exception[IOError] \x3d\n  internal::checkResult(internal::openForReading(path))\n\ndef openForWriting(path: String): File / Exception[IOError] \x3d\n  internal::checkResult(internal::openForWriting(path))\n\ndef openForAppending(path: String): File / Exception[IOError] \x3d\n  internal::checkResult(internal::openForAppending(path))\n\ndef read(file: File, buffer: ByteArray, offset: Int, size: Int, position: Int): Int / Exception[IOError] \x3d\n  internal::checkResult(internal::read(file, buffer, offset, size, position))\n\ndef write(file: File, buffer: ByteArray, offset: Int, size: Int, position: Int): Int / Exception[IOError] \x3d\n  internal::checkResult(internal::write(file, buffer, offset, size, position))\n\ndef close(file: File): Unit / Exception[IOError] \x3d {\n  internal::checkResult(internal::close(file)); ()\n}\n\ndef mkdir(path: String): Unit / Exception[IOError] \x3d {\n  internal::checkResult(internal::mkdir(path)); ()\n}\n\nnamespace internal {\n\n  extern js !!!MULTILINEMARKER!!!\n    /**\n     * Nodejs file operations expect buffers, but we represent buffers as typed arrays.\n     * This function converts between the two without copying.\n     */\n    function toBuffer(buffer) {\n      return Buffer.from(buffer.buffer, buffer.byteOffset, buffer.byteLength)\n    }\n  !!!MULTILINEMARKER!!!\n\n  extern jsNode !!!MULTILINEMARKER!!!\n    const fs \x3d require("fs");\n\n    function open(path, flags, callback) {\n      fs.open(path, flags, (err, file) \x3d\x3e {\n        if (err) { callback(err.errno) } else { callback(file) }\n      })\n    }\n\n    function read(file, buffer, offset, size, position, callback) {\n      let positionOrNull \x3d position \x3d\x3d\x3d -1 ? null : position;\n      fs.read(file, toBuffer(buffer), offset, size, positionOrNull, (err, bytesRead) \x3d\x3e {\n        if (err) { callback(err.errno) } else { callback(bytesRead) }\n      })\n    }\n\n    function write(file, buffer, offset, size, position, callback) {\n      let positionOrNull \x3d position \x3d\x3d\x3d -1 ? null : position;\n      fs.write(file, toBuffer(buffer), offset, size, positionOrNull, (err, bytesWritten) \x3d\x3e {\n        if (err) { callback(err.errno) } else { callback(bytesWritten) }\n      })\n    }\n\n    function close(file, callback) {\n      fs.close(file, (err) \x3d\x3e {\n        if (err) { callback(err.errno) } else { callback(0) }\n      })\n    }\n\n    function mkdir(path, callback) {\n      fs.mkdir(path, (err) \x3d\x3e {\n        if (err) { callback(err.errno) } else { callback(0) }\n      })\n    }\n  !!!MULTILINEMARKER!!!\n\n  extern llvm !!!MULTILINEMARKER!!!\n    declare void @c_fs_open_reading(%Pos, %Stack)\n    declare void @c_fs_open_writing(%Pos, %Stack)\n    declare void @c_fs_open_appending(%Pos, %Stack)\n    declare void @c_fs_read(%Int, %Pos, %Int, %Int, %Int, %Stack)\n    declare void @c_fs_write(%Int, %Pos, %Int, %Int, %Int, %Stack)\n    declare void @c_fs_close(%Int, %Stack)\n    declare void @c_fs_mkdir(%Pos, %Stack)\n  !!!MULTILINEMARKER!!!\n\n  extern async def openForReading(path: String): Int \x3d\n    jsNode "$effekt.capture(callback \x3d\x3e open(${path}, \'r\', callback))"\n    llvm !!!MULTILINEMARKER!!!\n      call void @c_fs_open_reading(%Pos ${path}, %Stack %stack)\n      ret void\n    !!!MULTILINEMARKER!!!\n\n  extern async def openForWriting(path: String): Int \x3d\n    jsNode "$effekt.capture(callback \x3d\x3e open(${path}, \'w\', callback))"\n    llvm !!!MULTILINEMARKER!!!\n      call void @c_fs_open_writing(%Pos ${path}, %Stack %stack)\n      ret void\n    !!!MULTILINEMARKER!!!\n\n  extern async def openForAppending(path: String): Int \x3d\n    jsNode "$effekt.capture(callback \x3d\x3e open(${path}, \'a\', callback))"\n    llvm !!!MULTILINEMARKER!!!\n      call void @c_fs_open_appending(%Pos ${path}, %Stack %stack)\n      ret void\n    !!!MULTILINEMARKER!!!\n\n  /// The buffer must be kept alive by using it after the call\n  extern async def read(file: Int, buffer: ByteArray, offset: Int, size: Int, position: Int): Int \x3d\n    jsNode "$effekt.capture(callback \x3d\x3e read(${file}, ${buffer}, ${offset}, ${size}, ${position}, callback))"\n    llvm !!!MULTILINEMARKER!!!\n      call void @c_fs_read(%Int ${file}, %Pos ${buffer}, %Int ${offset}, %Int ${size}, %Int ${position}, %Stack %stack)\n      ret void\n    !!!MULTILINEMARKER!!!\n\n  /// The buffer must be kept alive by using it after the call\n  extern async def write(file: Int, buffer: ByteArray, offset: Int, size: Int, position: Int): Int \x3d\n    jsNode "$effekt.capture(callback \x3d\x3e write(${file}, ${buffer}, ${offset}, ${size}, ${position}, callback))"\n    llvm !!!MULTILINEMARKER!!!\n      call void @c_fs_write(%Int ${file}, %Pos ${buffer}, %Int ${offset}, %Int ${size}, %Int ${position}, %Stack %stack)\n      ret void\n    !!!MULTILINEMARKER!!!\n\n  extern async def close(file: Int): Int \x3d\n    jsNode "$effekt.capture(callback \x3d\x3e close(${file}, callback))"\n    llvm !!!MULTILINEMARKER!!!\n      call void @c_fs_close(%Int ${file}, %Stack %stack)\n      ret void\n    !!!MULTILINEMARKER!!!\n\n  extern async def mkdir(path: String): Int \x3d\n    jsNode "$effekt.capture(callback \x3d\x3e mkdir(${path}, callback))"\n    llvm !!!MULTILINEMARKER!!!\n      call void @c_fs_mkdir(%Pos ${path}, %Stack %stack)\n      ret void\n    !!!MULTILINEMARKER!!!\n\n  def checkResult(result: Int): Int / Exception[IOError] \x3d\n    if (result \x3c 0) {\n      val ioError \x3d fromNumber(internal::errorNumber(result));\n      do raise[IOError](ioError, message(ioError))\n    } else {\n      result\n    }\n}\n\nnamespace examples {\n\n  // Example illustrating using abstract files interface\n  // and interpreting it into asynchronous IO\n  def copy(from: String, to: String): Unit / Files \x3d {\n    val contents \x3d do readFile(from)\n    do writeFile(to, contents)\n  }\n\n  def main() \x3d {\n    with on[IOError].panic;\n    with filesystem;\n\n    copy("README.md", "out/test.md")\n  }\n}\n');
